import React from 'react';
import './styles.css';

const Sidebar = () => {
  return (
    <div className="sidebar-wrapper">
      <ul>
        {catsList.map((cat)=>{
            return (
              <li key={cat.id}>
                <img src={cat.url} alt="" />
              </li>
            )
          })}
      </ul>
    </div>
  )
}

export default Sidebar;
